import React from 'react';
import './sidebar.css';

const Sidebar = ({ onDragStart }) => (
  <div className="sidebar">
    <div className="element" draggable onDragStart={e => onDragStart(e, 'label')}>Label</div>
    <div className="element" draggable onDragStart={e => onDragStart(e, 'input')}>Input</div>
    <div className="element" draggable onDragStart={e => onDragStart(e, 'button')}>Button</div>
  </div>
);

export default Sidebar;
